When STC Craft published Joelle Hoversons Last-Minute Knitted Gifts in 2004, the response was over-whelming and today there are nearly 100,000 copies of this classic in print. Six years later, Hoverson is full of fresh, new ideas for beautiful gifts. So STC proudly presents More Last-Minute Knitted Gifts: an elegant collection of 30 projects organized according to the time it takes to complete them, from less than two hours to more than eight. 
Among the projects featured are sachets, bracelets, ornaments, mittens, gloves, hats, sweaters, baby blankets, and throws.
